//www.linkedin.com/in/mldumont/","instagram":"https://www.instagram.com/heybrotherbear/"},{"id":6,"name":"Alex Padayao","image":"alex","width":"310px","height":"374px","role":"Writer","major":"International Business","bio":"Our ","bio2":"fashion-forward","bio3":" interviewer Alex can cook","bio4":"  1 minute rice","bio5":" in 58 seconds and is always looking to improve his wardrobe. He is fascinated by the complexities of design, especially what goes on behind the scenes of making a phone app or scripting a movie, so HUE was a natural fit for him.","color1":"#5c88da","color2":"#7c9fe1","color3":"#9db7e8","linkedin":"https://www.linkedin.com/in/alex-padayao-a8896b19a/","instagram":"https://www.instagram.com/alex_padayao/"},{"id":7,"name":"Mylinh Lac","image":"mylinh","width":"393px","height":"509px","role":"Creative Director","major":"Design and Interaction","bio":"Despite her dismay at ","bio2":"Animal Crossing : New Horizons","bio3":" being a Nintendo exclusive, Mylinh forges on at HUE, proud of the communal initiatives the zine takes on within the design community. Of HUE\u2019s dedicated team members, she says, \u201cbefore anything, we\u2019re friends.\u201d Of delicious","bio4":" spicy","bio5":" food, she says, \u201cbring it on.\u201d","color1":"#f1caad","color2":"#f3d4bd","color3":"#f6dfcd","linkedin":"https://www.linkedin.com/in/mylinh-lac/","instagram":"https://www.instagram.com/yourlinh/"},{"id":8,"name":"Adam Syed","image":"adam","width":"415px","height":"374px","role":"UX Designer","major":"Design and Interaction","bio":"With 3 years of UX Developing under his belt, Adam still believes that he\u2019s got a lot to learn. He joined HUE to see what else is in store for him in the ","bio2":"world of design.","bio3":" When he\u2019s not busy with being creative, he represents Malaysia at the international level as a ","bio4":" National Fencer.","bio5":"","color1":"#8d99ff","color2":"#a3adff","color3":"#bac1ff","linkedin":"https://www.linkedin.com/in/syedadamemirputra/","instagram":"https://www.instagram.com/syedadam007/"},{"id":9,"name":"Samantha Cheung","image":"samantha","width":"480px","height":"622px","role":"UX Designer","major":"Design and Interaction","bio":"Samantha loves to ","bio2":" embroider","bio3":" and has an eye for design. If given the chance, she\u2019d redesign those ","bio4":"tiny ERC kitchens","bio5":" because they\u2019re just too small! Samantha joined HUE to find a place within the UCSD design community that is passionate about creating something new and approaches design in a unique way.","color1":"#c05131","color2":"#cc735a","color3":"#d99683","linkedin":"https://www.linkedin.com/in/cheung-samantha/","instagram":"https://www.instagram.com/_samanthacheung/"},{"id":10,"name":"Lisa Zhou","image":"lisa","width":"331px","height":"378px","role":"Marketing","major":"Design and Interaction","bio":"HUE\u2019s very own resident  ","bio2":"rock climber","bio3":" Lisa is looking forward to gaining experience in media and marketing! Lisa joined HUE determined to build a creative community at UCSD, and given the chance, she\u2019d implement ","bio4":"efficient high-speed rails ","bio5":"across America; let\u2019s be honest, trains are better than planes anyways.","color1":"#346b5f","color2":"#679087","color3":"#99b5af","linkedin":"https://www.linkedin.com/in/lisa-zhou-826833194/","instagram":"https://www.instagram.com/lisa.z/"},{"id":11,"name":"Quylan Mac","image":"quylan","width":"308px","height":"371px","role":"Developer","major":"Computer Science","bio":"Owner of two dogs and ","bio2":"typer","bio3":" of 130 words/minute, Quylan joined HUE to improve his developing skills and make new friends! As a student, he looks to redesign assist.org in order to help his fellow undergrads save time and money by taking ","bio4":"classes","bio5":" at their local community college.","color1":"#b1c9e8","color2":"#c0d3ec","color3":"#d0def1","linkedin":"https://www.linkedin.com/in/quylanmac/","instagram":"https://www.instagram.com/quylanmac/"},{"id":12,"name":"Ryan Xu","image":"ryan","width":"298px","height":"377px","role":"Developer","major":"Computer Science","bio":"A man focused on his  ","bio2":" gains, ","bio3":"Ryan joined HUE in order to explore his creative side while simultaneously improving his developing skills. He hopes that RIMAC redesigns their weight room layout as cardio machines \u201cbelong\u201d on the bottom floor. His subtle flex, you may ask? ","bio4":"Flexing.","bio5":"","color1":"#754bbd","color2":"#9373cb","color3":"#b29bda","linkedin":"https://www.linkedin.com/in/ryan-xu-bb0b72197","instagram":"https://www.instagram.com/ryanxuu_/"},{"id":13,"name":"Juna Kim","image":"juna","width":"298px","height":"377px","role":"UX Designer","major":"Communication + Design","bio":"Grateful for the experience and community she found in UCSD Design Co, Juna wants to give back to the design community through her contributions in HUE. She would  ","bio2":" redesign the tiny desks ","bio3":"in lecture halls, which aren\'t big enough to accommodate all of her design ideas. Join her on a walk to get to know her and the adorable ","bio4":"white cat","bio5":" she frequently feeds when their routines collide.","color1":"#ffdc84","color2":"#ffe4a1","color3":"#fff1cc","linkedin":"https://www.linkedin.com/in/juna-kim/","instagram":"https://www.instagram.com/tunacchi/"},{"id":14,"name":"Jaiden McCrann","image":"jaiden","width":"298px","height":"377px","role":"Illustrator","major":"Visual Arts Media","bio":"Jaiden joined HUE to get creative and work alongside other dedicated students. Off the clock, she likes to appreciate the artistry of others through watching  ","bio2":" films and tv shows. ","bio3":"If she had the chance, Jaiden would love to redesign ","bio4":"Netflix suggestions","bio5":" so she can spend more time watching shows and attending events such as Walker Stalker Con, a ","bio6":"Walking Dead ","bio7":"convention!","color1":"#990099","color2":"#ce58ce","color3":"#cc80cc","